import { Component } from "@angular/core";

@Component({
  selector: 'app-cantantes-cantante',
  templateUrl: './cantante.component.html'
})

export class CantantesComponent{
  public name:string = 'Kurt Cobain'
  public age:number = 29;

  get getName():string{
    return this.name.toUpperCase();
  }

  public cambiarNombre():void{
    this.name = 'Freddy Mercury';
  }
}
<h1>{{name}}</h1>
<dl>
  <td>Nombre:</td>
  <dd>{{name}}</dd>

  <td>Edad:</td>
  <dd>{{age}}</dd>

  <td>Nombre en Mayúsculas</td>
  <dd> {{getName}}</dd>
</dl>

<button class="btn btn-primary" (click)="cambiarNombre()">Cambiar Nombre</button>
